import React from 'react';
import '../styles/App.css';
import Header from './areas/Header';
import { BrowserRouter } from 'react-router-dom'
import Main from './page/Main';

const App = () => {
  return (
    <div id="container">
      <BrowserRouter>
      <Header/>
      <Main/>
      </BrowserRouter>
    </div>
  )
}

export default App;
